ONT_SMOOTHING:'맥 전용: 서브픽셀 안티 에일리어싱을 활성화 하려면 "subpixel-antialiased" 회색조 안티 에일리어싱을 활성화 하려면 "antialiased"',DESCRIPTION_OPEN_PREFS_IN_SPLIT_VIEW:"분할 보기에서 파일 환경 설정 열기를 비 활성화 하려면 false",DESCRIPTION_OPEN_USER_PREFS_IN_SECOND_PANE:"사용자 환경 설정 파일을 좌측/상단 창에서 열려면 false",DESCRIPTION_MERGE_PANES_WHEN_LAST_FILE_CLOSED:"창 헤더의 닫기 버튼을 통해 마지막으로 닫힌 창을 접으려면 true",DESCRIPTION_SHOW_PANE_HEADER_BUTTONS:"헤더에 닫기 버튼과 반전 보기 버튼 표시 전환.",DEFAULT_PREFERENCES_JSON_HEADER_COMMENT:'/*\n * 이것은 {APP_NAME}에 의해 환경 설정이 지원된 읽기 전용 파일입니다.\n * 이 파일은 다른 창에서 열린 "brackets.json" 환경 설정 파일을 수정하기 위한 참조로 사용합니다.\n * {APP_NAME} 환경 설정을 어떻게 하는지에 관한 더 많은 정보는 웹 페이지를 참고하세요.\n * https://github.com/adobe/brackets/wiki/How-to-Use-Brackets#preferences\n */',DEFAULT_PREFERENCES_JSON_DEFAULT:"기본",DESCRIPTION_PURE_CODING_SURFACE:"{APP_NAME}에서 코드 전용 모드를 실행하고 다른 모든 UI 요소 숨기기를 활성화 하려면 true",DESCRIPTION_INDENT_LINE_COMMENT:"줄 주석의 들여쓰기를 활성화하려면 true",DESCRIPTION_RECENT_FILES_NAV:"최근 파일에서 탐색 활성화/비활성화",DESCRIPTION_LIVEDEV_WEBSOCKET_PORT:"라이브 미리 보기를 위해 WebSocket 서버가 실행되는 포트",DESCRIPTION_LIVE_DEV_HIGHLIGHT_SETTINGS:"라이브 미리보기 하이라이트 설정",DESCRIPTION_LIVEDEV_ENABLE_REVERSE_INSPECT:"라이브 미리보기 역방향 검사를 비활성화하려면 false",DESCRIPTION_LIVEDEV_NO_PREVIEW:"미리보기가 없습니다!",DESCRIPTION_LIVEDEV_NO_PREVIEW_DETAILS:"미리 볼 HTML 파일을 선택하십시오",DESCRIPTION_LIVEDEV_MAIN_HEADING:"어 오!<br> 현재 브라우저는 실시간 미리보기를 지원하지 않습니다.",DESCRIPTION_LIVEDEV_MAIN_SPAN:'<a href="https://phcode.io" style="color: white">phcode.io</a> 에서 Windows, Mac 및 Linux용 기본 앱을 다운로드하여 최고의 라이브 미리 보기 경험을 얻으십시오.<br>',DESCRIPTION_LIVEDEV_SECURITY:"phcode.dev의 보안 경고<br><br> 이 실시간 미리보기는 프로젝트가 아닌 파일에 액세스하려고 시도했습니다. 안전을 위해 액세스가 거부되었습니다. 신뢰할 수 없는 프로젝트에서 작업할 때는 주의하십시오.",DESCRIPTION_LIVEDEV_SECURITY_POPOUT_MESSAGE:"실시간 미리보기용 파일을 열려고 합니다. 이 프로젝트의 소스를 신뢰하는 경우에만 진행하세요. 계속하려면 '프로젝트 신뢰'를 클릭하고, 소스를 신뢰하지 않으면 이 창을 닫으세요.",TRUST_PROJECT:"트러스트 프로젝트",DOWNLOAD_FAILED:"다운로드 실패.",DOWNLOAD_COMPLETE:"다운로드를 완료하였습니다!",UPDATE_SUCCESSFUL:"업데이트 성공!",UPDATE_FAILED:"업데이트가 실패!",VALIDATION_FAILED:"검증에 실패했습니다!",INITIALISATION_FAILED:"초기화 실패!",CLE